import { Directive, Input, Output, EventEmitter, ChangeDetectorRef, OnChanges, SimpleChanges } from '@angular/core';
import { ControlValueAccessor } from '@angular/forms';
import { Type, CronUnixUIService, CronQuartzUIService } from '@sbzen/cron-core';

import { CronLocalization, localization, DeepPartial } from './cron-localization';
import { CronClassesSchema, generateSchema } from './styles';

type RawObject = DeepPartial<{
	[key: string]: string|RawObject;
}>;

@Directive()
export abstract class CronHostComponent implements ControlValueAccessor, OnChanges {
  @Output() readonly changed = new EventEmitter<string>();
  @Output() readonly tabChanged = new EventEmitter<Type>();
  @Input() cssClassPrefix = '';
  @Input() activeTab: Type = this.getActiveTab();
  @Input() tabs: Type[]|null = null;
  @Input() hideTabs = false;
  @Input() localization?: CronLocalization;
  @Input() set disabled(value: string|null|boolean) {
    const disableFields = value != null && `${value}` !== 'false';
    this.cronUI.setDisabled(disableFields);
  }

  protected onChange: ((cronValue: string) => {})|null = null;
  protected onTouched: (() => {})|null = null;
  readonly type = Type;
  schema: CronClassesSchema;

  constructor(
    private readonly cd: ChangeDetectorRef,
    private readonly cronUI: CronUnixUIService|CronQuartzUIService,
    private readonly initialTabs: Type[],
    private readonly styles: CronClassesSchema
  ) {
    this.schema = generateSchema(styles, this.cssClassPrefix);
  }

  ngOnChanges(changes: SimpleChanges) {
    const cssClassPrefix = changes['cssClassPrefix'];
    const shouldUpdate = (
      cssClassPrefix && cssClassPrefix.currentValue !== cssClassPrefix.previousValue
    );
    if (shouldUpdate) {
      this.schema = generateSchema(this.styles, this.cssClassPrefix);
      this.cd.detectChanges();
    }
  }

  writeValue(cronValue: string) {
    this.cronUI.fillFromExpression(cronValue || '');
  }

  registerOnChange(fn: (cronValue: string) => {}) {
    this.onChange = fn;
  }

  registerOnTouched(fn: () => {}) {
    this.onTouched = fn;
  }

  applyChanges() {
    const str = this.cronUI.toString();
    if (this.onChange) {
      this.onChange(str);
    }
    if (this.onTouched) {
      this.onTouched();
    }
    this.changed.emit(str);
  }

  getActiveTab() {
    const tabs = this.getTabs();
    const [firstTab] = tabs.length ? tabs : [this.initialTabs[0]];
    return this.activeTab || firstTab;
  }

  getTabs() {
    return this.tabs || this.initialTabs;
  }

  getLocalization() {
    const args: RawObject[] = [localization];
    if (this.localization) {
      args.push(this.localization);
    }
    return this.mergeDeep<typeof localization>(...args);
  }

  private mergeDeep<T extends RawObject>(...objects: RawObject[]) {
    return objects.reduce((prev, obj) => {
      Object.keys(obj).forEach(key => {
        const pVal = prev[key];
        const oVal = obj[key];

        if (pVal && typeof pVal === 'object' && oVal && typeof oVal === 'object') {
          prev[key] = this.mergeDeep(pVal, oVal);
        } else {
          prev[key] = oVal;
        }
      });

      return prev;
    }, {}) as T;
  }
}

import { Directive, Input, ChangeDetectorRef, Output, EventEmitter, OnInit, OnDestroy } from '@angular/core';
import { Mode, Segment, CronUnixUIService, CronQuartzUIService } from '@sbzen/cron-core';

import { CronClassesSchema } from './styles';
import { FullCronLocalization } from './cron-localization';

@Directive()
export abstract class CronTabComponent implements OnInit, OnDestroy {
  @Output() readonly changed = new EventEmitter<never>();
  @Input() localization!: FullCronLocalization;
  @Input() schema!: CronClassesSchema;

  private readonly sessionId = Date.now().toString();
  private unListener: (() => void)|null = null;
  protected abstract readonly segments: Segment[];
  protected abstract readonly cd: ChangeDetectorRef;

  abstract readonly cronUI: CronUnixUIService|CronQuartzUIService;
  readonly mode = Mode;

  ngOnInit() {
    this.unListener = this.cronUI.listen(this.segments, () => {
      this.cd.detectChanges();
      this.applyChanges();
    });
  }

  ngOnDestroy() {
    if (this.unListener) {
      this.unListener();
    }
  }

  genId(mode: Mode, extra?: string) {
    return `${mode}-${extra || ''}${this.sessionId}`;
  }

  localizeList(list: { value: string, label: string }[], localizationStore: { [key: string]: string }) {
    return list.map(v => ({
      ...v,
      label: this.localizeLabel(v.label, localizationStore)
    }));
  }

  localizeLabel(label: string, localizationStore: { [key: string]: string }) {
    return localizationStore[label.toLowerCase()]
  }

  protected applyChanges() {
    this.changed.emit();
  }
}

import { Directive, ViewChild } from '@angular/core';
import { Segment, Type } from '@sbzen/cron-core';

import { CronAndComponent } from './shared';
import { CronTabComponent } from './cron-tab.abstract';
import { CronSingleType } from './cron-single-tab.type';

@Directive()
export abstract class CronTabSingleSegmentComponent extends CronTabComponent {
  @ViewChild(CronAndComponent, { static: true }) and: CronAndComponent|null = null;
  readonly segments: Segment[];

  constructor(tab: CronSingleType) {
    super();
    this.segments = this.getSegments(tab);
  }

  protected override applyChanges() {
    if (this.and) {
      this.and.detectChanges();
    }
    super.applyChanges();
  }

  private getSegments(tab: CronSingleType) {
    const segment = new Map<CronSingleType, Segment>([
      [Type.HOURS, Segment.hours],
      [Type.MINUTES, Segment.minutes],
      [Type.MONTH, Segment.month],
      [Type.SECONDS, Segment.seconds],
      [Type.YEAR, Segment.year]
    ]).get(tab);

    if (!segment) {
      throw `No segments for tab: ${tab}`;
    }

    return [segment];
  }
}

