import { Component, Input, ContentChild, TemplateRef, ChangeDetectionStrategy, ChangeDetectorRef } from '@angular/core';

import { Tab, CronLocalization } from '@sbzen/ng-cron';

import { getLocalizationPathes, getLocalization } from './../localization';

@Component({
  selector: 'container',
  templateUrl: './container.html',
  changeDetection: ChangeDetectionStrategy.OnPush
})
export class ContainerComponent {
  @ContentChild('content') content!: TemplateRef<HTMLDivElement>;
  @Input() type = '';
  @Input() value = '';
  @Input() initialTabs = [Tab.SECONDS, Tab.MINUTES, Tab.HOURS, Tab.DAY, Tab.MONTH, Tab.YEAR];
  disabled? = false;
  hideTabs? = false;
  cssClassPrefix? = '';
  activeTab?: Tab;
  tabs?: Tab[];
  localization?: CronLocalization;
  readonly updateValue = (v: string) => this.setValue(v);
  readonly updateActiveTab = (v: Tab) => this.setActiveTab(v);

  constructor(private readonly cd: ChangeDetectorRef) {}

  handleValueUpdate(e: Event) {
    const el = e.target as HTMLInputElement;
    const value = el.value;
    this.setValue(value);
  }

  setValue(v: string) {
    this.value = v;
    this.cd.detectChanges();
  }

  setDisabled(v?: boolean) {
    this.disabled = v;
    this.cd.detectChanges();
  }

  setHideTabs(v?: boolean) {
    this.hideTabs = v;
    this.cd.detectChanges();
  }

  setCssClassPrefix(v?: string) {
    this.cssClassPrefix = v;
    this.cd.detectChanges();
  }

  setActiveTab(v?: Tab) {
    this.activeTab = v;
    this.cd.detectChanges();
  }

  setLocalization(v?: CronLocalization) {
    this.localization = v;
    this.cd.detectChanges();
  }

  setTabs(v?: Tab[]) {
    this.tabs = v;
    this.cd.detectChanges();
  }

  getLocalization() {
    return getLocalization();
  }

  getLocalizationPathes() {
    return getLocalizationPathes();
  }

  getLocalizationValue(path: string, loc = getLocalization()) {
    const paths = path.split('.');
    const lastProp = paths[paths.length - 1];
    // @ts-ignore
    const store = paths.slice(0, paths.length - 1).reduce((acc, prop) => acc[prop], loc);
    // @ts-ignore
    return store[lastProp];
  }

  updateLocalizationField(path: string, e: Event) {
    const el = e.target as HTMLInputElement;
    const localizationValue = el.value;
    const paths = path.split('.');
    const lastProp = paths[paths.length - 1];
    // @ts-ignore
    const store = paths.slice(0, paths.length - 1).reduce((acc, prop) => acc[prop], this.localization);
    // @ts-ignore
    store[lastProp] = localizationValue;
    this.setLocalization({ ...this.localization });
  }

  addedTab(tab: Tab) {
    return (this.tabs || []).includes(tab);
  }

  toggleTab(tab: Tab) {
    const tabsToUse = this.tabs || [];
    if (this.addedTab(tab)) {
      this.setTabs(tabsToUse.filter(t => t !== tab));
      return;
    }
    this.setTabs([...tabsToUse, tab]);
  }
}

import { Component, Input, Output, EventEmitter, ChangeDetectionStrategy, ChangeDetectorRef } from '@angular/core';
import { Mode } from '@sbzen/cron-core';

import { CronClassesSchema } from './../../styles';

@Component({
  selector: 'cron-and',
  templateUrl: './and.html',
  changeDetection: ChangeDetectionStrategy.OnPush
})
export class CronAndComponent {
  @Output() readonly selected = new EventEmitter<void>();
  @Input() checked = false;
  @Input() disabled = false;
  @Input() disabledControls = false;
  @Input() gridSize?: string;
  @Input() label = '';
  @Input() segmentId = '';
  @Input() options: {
    label: string|number,
    value: string
  }[] = [];
  @Input() isValueSelected: (value: string) => boolean = () => false;
  @Input() selectValue: (value: string) => boolean = () => false;
  @Input() schema!: CronClassesSchema;
  readonly mode = Mode.AND;

  constructor(private readonly cd: ChangeDetectorRef) {}

  changeValue(e: Event, value: string) {
    const status = this.selectValue(value);
    if (!status) {
      e.preventDefault();
    }
  }

  detectChanges() {
    this.cd.detectChanges();
  }
}

import { Component, ContentChild, TemplateRef, ChangeDetectionStrategy, Input, ChangeDetectorRef, Output, EventEmitter, ViewChildren, ElementRef, QueryList } from '@angular/core';
import { Type } from '@sbzen/cron-core';

import { CronLocalization } from './../cron-localization';
import { CronClassesSchema } from './../styles';

@Component({
  selector: 'cron-container',
  templateUrl: './container.html',
  styleUrls: ['./container.scss'],
  changeDetection: ChangeDetectionStrategy.OnPush
})
export class CronContainerComponent {
  @ContentChild('content') content!: TemplateRef<HTMLDivElement>;
  @ViewChildren('tabEl', { read: ElementRef }) tabEls: QueryList<ElementRef>|null = null;
  @Output() readonly tabChanged = new EventEmitter<Type>();
  @Input() localization!: Required<CronLocalization>;
  @Input() hostClass = '';
  @Input() activeTab = Type.MINUTES;
  @Input() tabs: Type[] = [];
  @Input() hideTabs = false;
  @Input() schema!: CronClassesSchema;

  readonly tabsLocalizationKeys = {
    [Type.DAY]: 'day',
    [Type.HOURS]: 'hours',
    [Type.MINUTES]: 'minutes',
    [Type.MONTH]: 'month',
    [Type.SECONDS]: 'seconds',
    [Type.YEAR]: 'year'
  } as const;

  constructor(private readonly cd: ChangeDetectorRef) {}

  navigateTab(code: string, tab: Type) {
    if (!this.tabEls || code !== 'ArrowRight' && code !== 'ArrowLeft') {
      return;
    }
    const tabEls = this.tabEls.toArray().map(er => er.nativeElement);
    const tabs = this.tabs;
    const pos = tabs.indexOf(tab);
    let toPos = 0;

    if (code === 'ArrowRight') {
      const nextPos = pos + 1;
      toPos = (nextPos === tabs.length) ? 0 : nextPos;
    }
    if (code === 'ArrowLeft') {
      const prevPos = pos - 1;
      toPos = (prevPos < 0) ? tabs.length - 1 : prevPos;
    }

    this.setTab(tabs[toPos]);
    const tabEl = tabEls[toPos];
    if (tabEl) {
      tabEl.focus();
      this.cd.detectChanges();
    }
  }

  setTab(tab: Type) {
    this.activeTab = tab;
    this.cd.detectChanges();
    this.tabChanged.emit(tab);
  }
}

import { Component, Input, Output, EventEmitter, ChangeDetectionStrategy } from '@angular/core';
import { Mode } from '@sbzen/cron-core';

import { CronClassesSchema } from './../../styles';

@Component({
  selector: 'cron-every',
  templateUrl: './every.html',
  changeDetection: ChangeDetectionStrategy.OnPush
})
export class CronEveryComponent {
  @Output() readonly selected = new EventEmitter<void>();
  @Input() checked = false;
  @Input() disabled = false;
  @Input() label = '';
  @Input() segmentId = '';
  @Input() schema!: CronClassesSchema;

