(obj: CronLocalization = getLocalization(), parentProp = '') => {
  return Object.keys(obj).reduce((acc, prop) => {
    const propsLine = [parentProp, prop].filter(a => !!a).join('.');

    // @ts-ignore
    const value = obj[prop];
    let values: string[] = [];

    if (typeof value !== 'string') {
      values = getLocalizationPathes(value, propsLine);
    } else {
      values = [propsLine];
    }

    return [
      ...acc,
      ...values
    ];
  }, [] as string[]);
}

